import React from 'react';
import Story from './Story';
import "./StoryReel.css";


function StoryReel() {
    return (
        <div className="storyReel">
            <Story image="" profileSrc="https://stargate.ncc.edu/~bla6003/personal-site/img/Icon2.png" title="Tedane Blake" />
            <Story image="" profileSrc="https://stargate.ncc.edu/~bla6003/personal-site/img/Icon2.png" title="Emily Blake" />
            <Story image="" profileSrc="https://www.avatarist.com/avatars/Movies/Star-Wars/Chibi-Chewbacca.jpg" title="Chasity Blake" />
            <Story image="" profileSrc="https://www.avatarist.com/avatars/Movies/American-Psycho-blood.jpg" title="Comarsh Blake" />
            <Story image="" profileSrc="https://www.avatarist.com/avatars/Movies/Star-Wars/Multicolored-Lightsaber.gif" title="Tequan Blake" />
            <Story image="" profileSrc="https://www.avatarist.com/avatars/Cartoons/Slagar-the-Cruel.jpg" title="Atetra Blake" />
        </div>
    )
}

export default StoryReel
